import Nav from 'react-bootstrap/Nav';
import React from 'react';
import { BrowserRouter, Routes, Route, Link } from 'react-router-dom';
import LoginPage from '../pages/LoginPage';
import LogsPage from '../pages/LogsPage';
import RequireAuth from './RequireAuth';
import SignupPage from '../pages/SignupPage';
import LogoutPage from '../pages/LogoutPage';
import { LinkContainer } from 'react-router-bootstrap'

function ListExample() {
  return (
    <BrowserRouter>
        <Nav defaultActiveKey="/" as="ul" id="navbar">
            <Nav.Item as="li">
                <LinkContainer to="/"><Nav.Link class="nav-button">Dashboard</Nav.Link></LinkContainer>
            </Nav.Item>
            <Nav.Item as="li">
                <Nav.Link class="nav-button">Exercise</Nav.Link>
            </Nav.Item>
            <Nav.Item as="li">
                <Nav.Link class="nav-button">Nutrition</Nav.Link>
            </Nav.Item>
            <Nav.Item as="li">
                <Nav.Link class="nav-button" eventKey="link-2">Log In</Nav.Link>
            </Nav.Item>
            <Nav.Item as="li">
                <Nav.Link class="nav-button">Log Out</Nav.Link>
            </Nav.Item>
            <Nav.Item as="li">
                <Nav.Link class="nav-button">Sign Up</Nav.Link>
            </Nav.Item>
        </Nav>

        <Routes>
            <Route index element={<RequireAuth><LogsPage /></RequireAuth>} />
            <Route path="/login" element={<LoginPage />} />
            <Route path="/signup" element={<SignupPage />} />
            <Route path="/logout" element={<LogoutPage />} />
        </Routes>
    </BrowserRouter>
  );
}

export default ListExample;
